import "./Signup.css"

function SignUpChoice() {
    return (
    <div class="background1">
      <div class="background2">
        <p class="heading2">S I G N &nbsp; U P</p>
        <div class="optns">
            <button class="nstep2"
                onClick={(e) => {
                    window.location.href = "/ressignup";
                }}>
                <div class="bsimg"/>
                Resident
            </button>
            <button class="nstep3"        
            onClick={(e) => {
                window.location.href = "/msignup";
            }}>
                <div class="shimg"/>
                Merchant
            </button>
        </div>

      </div>
      </div>
    )
  }
  export default SignUpChoice;
